package development

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_TARGET_ABSOLUTE_SENSOR_CAPABILITY_FLAGS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e TARGET_ABSOLUTE_SENSOR_CAPABILITY_FLAGS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := TARGET_ABSOLUTE_SENSOR_CAPABILITY_POSITION.MarshalText()
		require.NoError(t, err)

		var dec TARGET_ABSOLUTE_SENSOR_CAPABILITY_FLAGS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, TARGET_ABSOLUTE_SENSOR_CAPABILITY_POSITION, dec)
	})
}
